Properties The function that decides the chunk index for a validator will be parameterized by at least (validator_index, core_index) and have the following properties: deterministic relatively quick to compute and resource-efficient. when considering a fixed core_index, the function should describe a permutation of the chunk indices the validators that map to the first N/3 chunk indices should have as little overlap as possible for different cores. In other words, we want a uniformly distributed, deterministic mapping from ValidatorIndex to ChunkIndex per core. It's desirable to not embed this function in the runtime, for performance and complexity reasons. However, this means that the function needs to be kept very simple and with minimal or no external dependencies. Any change to this function could result in parachains being stalled and needs to be coordinated via a runtime upgrade or governance call. Proposed function Pseudocode: pub fn get_chunk_index( n_validators: u32, validator_index: ValidatorIndex, core_index: CoreIndex
) -> ChunkIndex { let threshold = systematic_threshold(n_validators); // Roughly n_validators/3 let core_start_pos = core_index * threshold; (core_start_pos + validator_index) % n_validators
}

