The request-response /req_chunk protocol will be bumped to a new version (from v1 to v2). For v1, the request and response payloads are: /// Request an availability chunk.
pub struct ChunkFetchingRequest { /// Hash of candidate we want a chunk for. pub candidate_hash: CandidateHash, /// The index of the chunk to fetch. pub index: ValidatorIndex,
} /// Receive a requested erasure chunk.
pub enum ChunkFetchingResponse { /// The requested chunk data. Chunk(ChunkResponse), /// Node was not in possession of the requested chunk. NoSuchChunk,
} /// This omits the chunk's index because it is already known by
/// the requester and by not transmitting it, we ensure the requester is going to use his index
/// value for validating the response, thus making sure he got what he requested.
pub struct ChunkResponse { /// The erasure-encoded chunk of data belonging to the candidate block. pub chunk: Vec<u8>, /// Proof for this chunk's branch in the Merkle tree. pub proof: Proof,
} Version 2 will add an index field to ChunkResponse: #[derive(Debug, Clone, Encode, Decode)]
pub struct ChunkResponse { /// The erasure-encoded chunk of data belonging to the candidate block. pub chunk: Vec<u8>, /// Proof for this chunk's branch in the Merkle tree. pub proof: Proof, /// Chunk index. pub index: ChunkIndex
} An important thing to note is that in version 1, the ValidatorIndex value is always equal to the ChunkIndex. Until the chunk rotation feature is enabled, this will also be true for version 2. However, after the feature is enabled, this will generally not be true. The requester will send the request to validator with index V. The responder will map the V validator index to the C chunk index and respond with the C-th chunk. This mapping can be seamless, by having each validator store their chunk by ValidatorIndex (just as before). The protocol implementation MAY check the returned ChunkIndex against the expected mapping to ensure that it received the right chunk. In practice, this is desirable during availability-distribution and systematic chunk recovery. However, regular recovery may not check this index, which is particularly useful when participating in disputes that don't allow for easy access to the validator->chunk mapping. See Appendix A for more details. In any case, the requester MUST verify the chunk's proof using the provided index. During availability-recovery, given that the requester may not know (if the mapping is not available) whether the received chunk corresponds to the requested validator index, it has to keep track of received chunk indices and ignore duplicates. Such duplicates should be considered the same as an invalid/garbage response (drop it and move on to the next validator - we can't punish via reputation changes, because we don't know which validator misbehaved).

