To give an example, if you send one notification with three transactions, the bytes that are sent on the wire are: concat( leb128(total-size-in-bytes-of-the-rest), scale(compact(3)), scale(transaction1), scale(transaction2), scale(transaction3)
) But you can also send three notifications of one transaction each, in which case it is: concat( leb128(size(scale(transaction1)) + 1), scale(compact(1)), scale(transaction1), leb128(size(scale(transaction2)) + 1), scale(compact(1)), scale(transaction2), leb128(size(scale(transaction3)) + 1), scale(compact(1)), scale(transaction3)
) Right now the sender can choose which of the two encoding to use. This RFC proposes to make the second encoding mandatory. The format of the notification would become a SCALE-encoded (Compact(1), Transaction). A SCALE-compact encoded 1 is one byte of value 4. In other words, the format of the notification would become concat(&[4], scale_encoded_transaction). This is equivalent to forcing the Vec<Transaction> to always have a length of 1, and I expect the Substrate implementation to simply modify the sending side to add a for loop that sends one notification per item in the Vec. As explained in the motivation section, this allows extracting scale(transaction) items without having to know how to decode them. By "flattening" the two-steps hierarchy, an implementation only needs to back-pressure individual notifications rather than back-pressure notifications and transactions within notifications.

