For decoding an extrinsic, more information on what types are being used is required. The actual format of the extrinsic is the format as described in the Polkadot specification . The metadata for an extrinsic is as follows: struct ExtrinsicMetadata { version: u8, address_ty: TypeRef, call_ty: TypeRef, signature_ty: TypeRef, signed_extensions: Vec<SignedExtensionMetadata>,
} struct SignedExtensionMetadata { identifier: String, included_in_extrinsic: TypeRef, included_in_signed_data: TypeRef,
} To begin with, TypeRef. This is a unique identifier for a type as found in the type information. Using this TypeRef, it is possible to look up the type in the type information tree. More details on this process can be found in the section Generating TypeRef . The actual ExtrinsicMetadata contains the following information: version: The version of the extrinsic format. As of writing this, the latest version is 4. address_ty: The address type used by the chain. call_ty: The call type used by the chain. The call in FRAME based runtimes represents the type of transaction being executed on chain. It references the actual function to execute and the parameters of this function. signature_ty: The signature type used by the chain. signed_extensions: FRAME based runtimes can extend the base extrinsic with extra information. This extra information that is put into an extrinsic is called "signed extensions". These extensions offer the runtime developer the possibility to include data directly into the extrinsic, like nonce, tip, amongst others. This means that the this data is sent alongside the extrinsic to the runtime. The other possibility these extensions offer is to include extra information only in the signed data that is signed by the sender. This means that this data needs to be known by both sides, the signing side and the verification side. An example for this kind of data is the genesis hash that ensures that extrinsics are unique per chain. Another example is the metadata hash itself that will also be included in the signed data. The offline wallets need to know which signed extensions are present in the chain and this is communicated to them using this field. The SignedExtensionMetadata provides information about a signed extension: identifier: The identifier of the signed extension. An identifier is required to be unique in the Polkadot ecosystem as otherwise extrinsics are maybe built incorrectly. included_in_extrinsic: The type that will be included in the extrinsic by this signed extension. included_in_signed_data: The type that will be included in the signed data by this signed extension.

