A complete binary merkle tree with blake3 as the hashing function is proposed. For building the merkle tree root, the initial data has to be hashed as a first step. This initial data is referred to as the leaves of the merkle tree. The leaves need to be sorted to make the tree root deterministic. The type information is sorted using their unique identifiers and for the Enumeration, variants are sort using their index. After sorting and hashing all leaves, two leaves have to be combined to one hash. The combination of these of two hashes is referred to as a node . let nodes = leaves;
while nodes.len() > 1 { let right = nodes.pop_back(); let left = nodes.pop_back(); nodes.push_front(blake3::hash(scale::encode((left, right))));
