This exists only as a short illustration of a potential technical implementation and should not be treated as anything more. Regions This data schema achieves a number of goals: Coretime can be individually traded at a level of a single usage of a single core. Coretime Regions, of arbitrary span and up to 1/80th interlacing can be exposed as NFTs and exchanged. Any Coretime Region can be contributed to the Instantaneous Coretime Pool. Unlimited number of individual Coretime contributors to the Instantaneous Coretime Pool. (Effectively limited only in number of cores and interlacing level; with current values this would allow 80,000 individual payees per timeslice). All keys are self-describing. Workload to communicate core (re-)assignments is well-bounded and low in weight. All mandatory bookkeeping workload is well-bounded in weight. type Timeslice = u32; // 80 block amounts.
type CoreIndex = u16;
type CoreMask = [u8; 10]; // 80-bit bitmap. // 128-bit (16 bytes)
struct RegionId { begin: Timeslice, core: CoreIndex, mask: CoreMask,
}
// 296-bit (37 bytes)
struct RegionRecord { end: Timeslice, owner: AccountId,
} map Regions = Map<RegionId, RegionRecord>; // 40-bit (5 bytes). Could be 32-bit with a more specialised type.
enum CoreTask { Off, Assigned { target: TaskId }, InstaPool,
}
// 120-bit (15 bytes). Could be 14 bytes with a specialised 32-bit `CoreTask`.
struct ScheduleItem { mask: CoreMask, // 80 bit task: CoreTask, // 40 bit
} /// The work we plan on having each core do at a particular time in the future.
type Workplan = Map<(Timeslice, CoreIndex), BoundedVec<ScheduleItem, 80>>;
/// The current workload of each core. This gets updated with workplan as timeslices pass.
type Workload = Map<CoreIndex, BoundedVec<ScheduleItem, 80>>; enum Contributor { System, Private(AccountId),
} struct ContributionRecord { begin: Timeslice, end: Timeslice, core: CoreIndex, mask: CoreMask, payee: Contributor,
}
type InstaPoolContribution = Map<ContributionRecord, ()>; type SignedTotalMaskBits = u32;
type InstaPoolIo = Map<Timeslice, SignedTotalMaskBits>; type PoolSize = Value<TotalMaskBits>; /// Counter for the total CoreMask which could be dedicated to a pool. `u32` so we don't ever get
/// an overflow.
type TotalMaskBits = u32;
struct InstaPoolHistoryRecord { total_contributions: TotalMaskBits, maybe_payout: Option<Balance>,
}
/// Total InstaPool rewards for each Timeslice and the number of core Mask which contributed.
type InstaPoolHistory = Map<Timeslice, InstaPoolHistoryRecord>; CoreMask tracks unique "parts" of a single core. It is used with interlacing in order to give a unique identifier to each component of any possible interlacing configuration of a core, allowing for simple self-describing keys for all core ownership and allocation information. It also allows for each core's workload to be tracked and updated progressively, keeping ongoing compute costs well-bounded and low. Regions are issued into the Regions map and can be transferred, partitioned and interlaced as the owner desires. Regions can only be tasked if they begin after the current scheduling deadline (if they have missed this, then the region can be auto-trimmed until it is). Once tasked, they are removed from there and a record is placed in Workplan. In addition, if they are contributed to the Instantaneous Coretime Pool, then an entry is placing in InstaPoolContribution and InstaPoolIo. Each timeslice, InstaPoolIo is used to update the current value of PoolSize. A new entry in InstaPoolHistory is inserted, with the total_contributions field of InstaPoolHistoryRecord being informed by the PoolSize value. Each core's has its Workload mutated according to its Workplan for the upcoming timeslice. When Instantaneous Coretime Market Revenues are reported for a particular timeslice from the Relay-chain, this information gets placed in the maybe_payout field of the relevant record of InstaPoolHistory. Payments can be requested made for any records in InstaPoolContribution whose begin is the key for a value in InstaPoolHistory whose maybe_payout is Some. In this case, the total_contributions is reduced by the ContributionRecord's mask and a pro rata amount paid. The ContributionRecord is mutated by incrementing begin, or removed if begin becomes equal to end. Example: // Simple example with a `u16` `CoreMask` and bulk sold in 100 timeslices.
Regions:
