The PVQ extension system has the following features: Defines an extension as a Rust trait with optional associated types. Example Design : The following code declares two extensions: extension_core and extension_fungibles with some associated types. #[extension_decl]
pub mod extension_core { #[extension_decl::extension] pub trait ExtensionCore { type ExtensionId; fn has_extension(id: Self::ExtensionId) -> bool; }
} #[extension_decl]
pub mod extension_fungibles { #[extension_decl::extension] pub trait ExtensionFungibles { type AssetId; type Balance; type AccountId; fn total_supply(asset: Self::AssetId) -> Self::Balance; fn balance(asset: Self::AssetId, who: Self::AccountId) -> Self::Balance; }
} The following code implements the extensions, amalgamates them and generates the corresponding metadata. #[extensions_impl]
pub mod extensions { #[extensions_impl::impl_struct] pub struct ExtensionsImpl; #[extensions_impl::extension] impl pvq_extension_core::extension::ExtensionCore for ExtensionsImpl { type ExtensionId = u64; fn has_extension(id: Self::ExtensionId) -> bool { matches!(id, 0 | 1) } } #[extensions_impl::extension] impl pvq_extension_fungibles::extension::ExtensionFungibles for ExtensionsImpl { type AssetId = u32; type AccountId = [u8; 32]; type Balance = u64; fn total_supply(_asset: Self::AssetId) -> Self::Balance { 100 } fn balance(_asset: Self::AssetId, _who: Self::AccountId) -> Self::Balance { 100 } }
} Hash-based extension id generation mechanism Extensions are uniquely identified by a hash value computed from their name and method names. This means that modifying either the extension name or its method names results in a new extension. This design allows new functionality to be added independently of the PVQ core version, enabling a permissionless extension system while keeping the core implementation minimal. The extension ID generation can be expressed mathematically as: $ExtID = twox64(P \parallel E \parallel M_1 \parallel M_2 \parallel ... \parallel M_n)$ Where: $P$ is the prefix string constant, pvq-ext $E$ is the extension name $M_1...M_n$ are the method names in lexicographical order $\parallel$ represents string concatenation with a separator @ to avoid collision $twox64()$ is the 64-bit xxHash function A permission control system allows filtering extension method invocations based on their origin (Runtime, Extrinsics, RuntimeAPI, or XCM). This enables runtime developers to restrict certain functions from being called through specific interfaces, such as preventing access via XCM when desired.

