The PVQ Executor provides a unified interface that only takes query programs with corresponding arguments and returns results. It can be formulated as a PVM program-argument invocation, as detailed in Appendix A.8 in the JAM Gray Paper . Specifically, we call it PVQ invocation. Program initialization and Results Return PVQ program size limit: While the standard PVM code format contains instructions, jump table, and initial RAM state information, PVQ programs can be significantly trimmed down. This is because PVQ separates computation logic from state access: the computation happens in the program while state access is handled through host functions. This makes the program stateless, allowing us to eliminate the initial read-write (heap) data and stack sections along with their length encodings in the PVQ program binary. The read-only data section can be minimized to only contain essential utility data like host function extension IDs, keeping it within a reasonable size limit. Entrypoint: PVQ programs have a single static entrypoint that begins at instruction 0, since all PVQ computation can be expressed through a single entry point. Argument passing: Query data is encoded as invocation arguments. Specifically, it includes the view function index and its arguments. As discussed in Equation A.36 in the Gray Paper , arguments start at 0xfeff0000 which is stored in a0(7th register), and the length is specified at a1(8th register). Return results As discussed in Equation A.39 in the Gray Paper , the invocation returns its output through register a0 (7th register), which contains a pointer to the output buffer. Register a1(8th register) contains the length of the output buffer. The output buffer must be allocated within the program's memory space and contain the SCALE-encoded return value. Host Functions The following host functions are available to PVQ invocations. The index numbers shown below correspond to the values used in the ecalli instruction. extension_call: A unified entry point that routes queries to various extensions. It accepts two parameters: extension_id A u64 value for selecting which extension to query, split across two 32-bit registers: lower 32 bits in a0 and upper 32 bits in a1 query_data SCALE-encoded value including the view function index and its arguments, pointer in a2 and length in a3. The returned results are stored in registers a0 (pointer) and a1 (length). The output buffer contains the SCALE-encoded return value. All host functions must properly account for and deduct gas based on their computational costs. Example Rust Implementation using PolkaVM SDK : #[polkavm_derive::polkavm_import]
extern "C" { fn extension_call(extension_id:u64, call_ptr:u32, call_len: u32) -> (u32, u32);
} PVQ Executor Implementation Practically, the executor has a core method execute to initialize the program and perform argument invocation, which takes: program: PVQ main binary. args: PVQ query data. gas_limit: Maximum PVM gas limit for the query. If not provided, the executor works at no gas metering mode. Example Rust Implementation : pub fn execute( &mut self, program: &[u8], args: &[u8], gas_limit: Option<i64>,
) -> Result<Vec<u8>, PvqExecutorError> {...} pub enum PvqExecutorError<UserError> { InvalidProgramFormat, MemoryAccessError(polkavm::MemoryAccessError), Trap, NotEnoughGas, User(UserError), OtherPvmError(polkavm::Error), // Implementors can define additional error variants to differentiate specific panic reasons for internal debugging purposes.
} Additionally, it provides an initialization method that sets up the PVM execution environment and external interfaces by pre-registering the required host functions: Example Rust Implementation : pub fn new(context: PvqContext) -> Self

