In the current implementation of the registrar pallet, there are two constants that specify the necessary deposit for parachains to register and store their validation code: trait Config { // -- snip -- /// The deposit required for reserving a `ParaId`. #[pallet::constant] type ParaDeposit: Get<BalanceOf<Self>>; /// The deposit to be paid per byte stored on chain. #[pallet::constant] type DataDepositPerByte: Get<BalanceOf<Self>>;
} This RFC proposes the addition of three new constants that will determine the payment amount and the frequency of the recurring rent payment: trait Config { // -- snip -- /// Defines how frequently the rent needs to be paid. /// /// The duration is set in sessions instead of block numbers. #[pallet::constant] type RentDuration: Get<SessionIndex>; /// The initial deposit amount for registering validation code. /// /// This is defined as a proportion of the deposit that would be required in the regular /// model. #[pallet::constant] type RentalDepositProportion: Get<Perbill>; /// The recurring rental cost defined as a proportion of the initial rental registration deposit. #[pallet::constant] type RentalRecurringProportion: Get<Perbill>;
} Users will be able to reserve a ParaId and register their validation code for a proportion of the regular deposit required. However, they must also make additional rent payments at intervals of T::RentDuration. For registering using the new rental system we will have to make modifications to the paras-registrar pallet. We should expose two new extrinsics for this: mod pallet { // -- snip -- pub fn register_rental( origin: OriginFor<T>, id: ParaId, genesis_head: HeadData, validation_code: ValidationCode, ) -> DispatchResult { /* ... */ } pub fn pay_rent(origin: OriginFor<T>, id: ParaId) -> DispatchResult { /* ... */ }
} A call to register_rental will require the reservation of only a percentage of the deposit that would otherwise be required to register the validation code when using the regular model. As described later in the Quick para re-registering section below, we will also store the code hash of each parachain to enable faster re-registration after a parachain has been pruned. For this reason the total initial deposit amount is increased to account for that. // The logic for calculating the initial deposit for parachain registered with the // new rent-based model: let validation_code_deposit = per_byte_fee.saturating_mul((validation_code.0.len() as u32).into()); let head_deposit = per_byte_fee.saturating_mul((genesis_head.0.len() as u32).into())
let hash_deposit = per_byte_fee.saturating_mul(HASH_SIZE); let deposit = T::RentalDepositProportion::get().mul_ceil(validation_code_deposit) .saturating_add(T::ParaDeposit::get()) .saturating_add(head_deposit) .saturating_add(hash_deposit) Once the ParaId is reserved and the validation code is registered the rent must be periodically paid to ensure the on-demand parachain doesn't get removed from the state. The pay_rent extrinsic should be callable by anyone, removing the need for the parachain to depend on the parachain manager for rent payments.

