One possible solution is to allow a proxy to create or replicate a pure proxy relationship for the same pure account on a target chain. For example, Alice, as the proxy of the pure1 pure account on parachain A, should be able to set a proxy for the same pure1 account on parachain B. To minimise security risks, the parachain B should grant the parachain A the least amount of permission necessary for the replication. First, Parachain A claims to Parachain B that the operation is commanded by the pure account, and thus by its proxy, and second, provides proof that the account is keyless. The replication process will be facilitated by XCM, with the first claim made using the DescendOrigin instruction. The replication call on parachain A would require a signed origin by the pure account and construct an XCM program for parachain B, where it first descends the origin, resulting in the ParachainA/AccountId32(pure1) origin location on the receiving side. To prove that the pure account is keyless, the client must provide the initial preimage used by the chain to derive the pure account. Parachain A verifies it and sends it to parachain B with the replication request. We can draft a pallet extension for the proxy pallet, which needs to be initialised on both sides to enable replication: // Simplified version to illustrate the concept.
mod pallet_proxy_replica { /// The part of the pure account preimage that has to be provided by a client. struct Witness { /// Pure proxy swapner spawner: AccountId, /// Disambiguation index index: u16, /// The block height and extrinsic index of when the pure account was created. block_number: BlockNumber, /// The extrinsic index. ext_index: u32, // Part of the preimage, but constant. // proxy_type: ProxyType::Any, } // ... /// The replication call to be initiated on the source chain. // Simplified version, the XCM part will be abstracted by the `Config` trait. fn replicate(origin: SignedOrigin, witness: Witness, proxy: xcm::Location) -> ... { let pure = ensure_signed(origin); ensure!(pure == proxy_pallet::derive_pure_account(witness), Error::NotPureAccount); let xcm = vec![ DescendOrigin(who), Transact( //  origin_kind: OriginKind::Xcm, call: pallet_proxy_replica::create(witness, proxy).encode(), ) ]; xcmTransport::send(xcm)?; } //  /// The call initiated by the source chain on the receiving chain. // `Config::CreateOrigin` - generally open for whitelisted parachain IDs and // converts `Origin::Xcm(ParachainA/AccountId32(pure1))` to `AccountID(pure1)`. fn create(origin: Config::CreateOrigin, witness: Witness, proxy: xcm::Location) -> ... { let pure = T::CreateOrigin::ensure_origin(origin); ensure!(pure == proxy_pallet::derive_pure_account(witness), Error::NotPureAccount); proxy_pallet::create_pure_proxy(pure, proxy); }
}

