In order to run a transaction with a signed origin in extrinsic version 5, a user must create the transaction with an instance of at least one extension responsible for authorizing Signed origins with a provided signature. As stated before, PR3685 comes with a Transaction Extension which replicates the current Signed transactions in v5 extrinsics, namely VerifySignature . I will use this extension as an example on how to replicate current Signed transaction functionality in the new v5 extrinsic format, though the runtime logic is not constrained to this particular implementation. This extension leverages the new inherited implication functionality introduced in TransactionExtension and creates a payload to be signed using the data of all extensions after itself in the extension pipeline. This extension can be configured to accept a MultiSignature, which makes it compatible with all signature types currently used in Polkadot. In the context of using an extension such as VerifySignature, for example, to replicate current Signed transaction functionality, the steps to generate the payload to be signed would be: The extension version byte, call, extension and extension implicit should be encoded (by "extension" and its implicit we mean only the data associated with extensions that follow this one in the composite extension type); The result of the encoding should then be hashed using the BLAKE2_256 hasher; The result of the hash should then be signed with the signature type specified in the extension definition. // Step 1: encode the bytes
let encoded = (extension_version_byte, call, transaction_extension, transaction_extension_implicit).encode();
// Step 2: hash them
let payload = blake2_256(&encoded[..]);
// Step 3: sign the payload
let signature = keyring.sign(&payload[..]);

